response.about:
Меня зовут Ангелина Экучиди.Практикую западную астрологию с 2021г.Два года назад увлечение переросло в обучение,я прошла первый курс Натальной астрологии у Надежды Яцуты.В 2022г.окончила второй курс по Прогностике.Беру на просмотр ситуации от 3х месяцев до 12мес.В данный момент предлагаю трактовку:             

-Натальной карты;                            
-детская Натальная карта;
-профориентация;
-прогностика;                        
-соляр;
-переезд;         
-встреча партнера;
-годовой прогноз.
Цены в директ
